@Booksmart completely fucking floored me. Added a fresh perspective on the #ComingOfAge #TeenComedy gene, and set a whole new standard for it. 

@oliviawilde @BeanieFeldstein @KaitlynDever you absolute queens. 

Also is Beanie single? I'd love to be your wife.

#Booksmart

