I saw #BookSmartMovie and it is one of best and funniest teen coming-of-age raunch comedies in years. 

@oliviawilde kills it on the directorial vision, the script is nicely refined and tight, and the cast is talented as hell. 

Don't Sleep on this one - go see #Booksmart pic.twitter.com/ZsJCxqxTjK

@praisethelourd @KaitlynDever @BeanieFeldstein @LisaKudrow @dianasilvers13 @oliviawilde 
I love #Booksmart so much! I haven’t had a film that made me laugh like this in so long now! Definitely one of my favorite films this year! I can’t wait to see it again! Thank y’all! 
